import React from "react";
import {
  Container,
  Row,
  Col,
  Card,
  CardHeader,
  CardBody,
  Badge
} from "reactstrap";
import AccountUnit from "./account/account-unit.js";

class Profile extends React.Component {
  render() {
    return (
      <section className="section pt-0">
        <Container>
          <div className="landing-position-relative">
            <section className="section pt-0 pb-2">
              <Row>
                <Col lg="12">
                  <Row className="m-0 d-flex justify-content-center">
                    <AccountUnit
                      _text="میزان هزینه شخصی"
                      imageUri={require("../assets/img/theme/team-4-800x800.jpg")}
                    />

                    <AccountUnit
                      _text="میزان هزینه گروهی"
                      imageUri={require("../assets/img/theme/team-4-800x800.jpg")}
                    />

                    <AccountUnit
                      _text="میزان مصرف گروهی"
                      imageUri={require("../assets/img/theme/team-4-800x800.jpg")}
                    />

                    <AccountUnit
                      _text="وضعیت نهایی"
                      imageUri={require("../assets/img/theme/team-4-800x800.jpg")}
                    />
                  </Row>
                </Col>
              </Row>
            </section>
          </div>
        </Container>
      </section>
    );
  }
}

export default Profile;
